import React from "react";
import "./SignUp.module.css";
import { Link } from "react-router-dom";

const LogIn = () => {
  const onSubmitHandler = (event) => {
    event.preventDefault();
  };

  return (
    // <div class="background">
    //   <br /><br />
    //   <p id="login">Login </p><br /> <p id="signin">Not a member yet? <u style="color:lightblue;"><a href="/signin"> Sign in </a> </u></p>
    //   <div class="social_media">
    //     <button id="Facebook"><a style="text-decoration: none;color:white" href="{% provider_login_url 'facebook' %}">Log in with Facebook</a></button>
    //     <button id="Gmail"><a style="text-decoration: none;color:white" href="{% provider_login_url 'google' %}">Log in with Gmail</a></button>
    //   </div>

    //   <form action="login" method="post">
    //     <div class="container">
    //       <input type="text" placeholder="Enter Username" name="username" required /><br />
    //       <input type="password" placeholder="Enter Password" name="password" required /><br />
    //       <input type="checkbox" checked="checked_box" style="margin-left:-20px;" /> Remember me
    //       <a href="#" style="margin-left:200px;">Forgot password? </a><br /><br /><br />
    //       <button type="submit" class="button log_but">Login</button> <br />
    //     </div>
    //   </form>
    // </div>

    <div>
      <form onSubmit={onSubmitHandler}>
        <label htmlFor="username">Username</label>
        <input
          type="text"
          id="username"
          name="username"
          placeholder="Your username.."
        />

        <label htmlFor="password">Password</label>
        <input tyoe="password" id="password" placeholder="Your password.." />

        <input type="submit" value="Log In" />

        <button type="Submit">Submit</button>
      </form>
    </div>
  );
};

export default LogIn;
